import React from 'react';
import TicTacToe from './TicTacToe';
import './App.css';
import { TicTacToeProvider } from './provider/TicTacToeProvider';

function App() {
  return (
    <TicTacToeProvider>
      <TicTacToe />
    </TicTacToeProvider>
  )
}

export default App;
